    <div className="primarycon">
      <Navbar/>
      <div className='bodycontainer'>
      <Switch>
      <Route path="/" exact component={HomePage} />
      <Route path="/compare" component={Compare} />
      </Switch>
      </div>

    </div>
    </Router>
  );
}

export default App;
